	def test_has_error(self):
		self.assertTrue(has_error("Bhopal",weather_response("Delhi","793c3089eb4630d64522f9b0ac09f2ed")))
		self.assertFalse(has_error("Mumbai",weather_response("Mumbai","2c08265798db149331176ee8d4549e5e")))
		self.assertTrue(has_error("Ahmedabad",weather_response("Mumbai","2c08265798db149331176ee8d4549e5e")))
		self.assertTrue(has_error("Hyderabad",weather_response("Delhi","793c3089eb4630d64522f9b0ac09f2ed")))
		self.assertFalse(has_error("Delhi",weather_response("Delhi","793c3089eb4630d64522f9b0ac09f2ed")))

	def test_get_temperature(self):
		self.assertAlmostEqual(get_temperature(weather_response("Chennai","d77643407f218aef553029eee7bfa4e8"),1,'21:00:00'),299.35,delta=5)
		self.assertAlmostEqual(get_temperature(weather_response("Mumbai","2c08265798db149331176ee8d4549e5e"),1,'15:00:00'),302.36,delta=5)
		self.assertAlmostEqual(get_temperature(weather_response("Chandigarh","8eba0228b4cf15fc970d435cbb20bd60"),2,'06:00:00'),301.72,delta=5)
		self.assertAlmostEqual(get_temperature(weather_response("Delhi","793c3089eb4630d64522f9b0ac09f2ed"),3,'12:00:00'),303.07,delta=5)
		self.assertAlmostEqual(get_temperature(weather_response("Kolkata","3399a48e738801b7ba8c175bc13f84e2"),4,'18:00:00'),301.32,delta=5)

	def test_get_humidity(self):
		self.assertAlmostEqual(get_humidity(weather_response("Chennai","d77643407f218aef553029eee7bfa4e8"),1,'21:00:00'),100,delta=5)
